import React from 'react';

const Projects = ({ setCurrentPage }) => {
    const handleLinkClick = (page) => {
      setCurrentPage(page);
    };
  return (
    <header>
      <h1>Projects</h1>
      <nav>
        <ul>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('home')}
            >
              Home
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('about')}
            >
              About
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('projects')}
            >
              Projects
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('contact')}
            >
              Contact
            </button>
          </li>
        </ul>
      </nav>

      <div style={projectContainerStyle}>
        <div style={projectBoxStyle}>
          <img src={require('./images/toby.jpg')} alt="Toby" style={imageStyle} />
          <div style={descriptionStyle}>
            <h2>Toby Bot</h2>
            <p>A chat and sound bot for Discord inspired by my Cocker Spaniel/ Beagle mix dog Toby</p>
            <p></p>
          </div>
        </div>
      </div>

      <div style={projectContainerStyle}>
        <div style={projectBoxStyle}>
          <div style={descriptionStyle}>
            <h2>BlexCloud</h2>
            <p>An application that creates a WordCloud out of Google search results</p>
            <p></p>
          </div>
          <img src={require('./images/Blexcloud1.PNG')} alt="Toby" style={imageStyle} />
          <p></p>
          <img src={require('./images/Blexcloud2.PNG')} alt="Toby" style={imageStyle} />
          <p></p>
          <img src={require('./images/Blexcloud3.png')} alt="Toby" style={imageStyle} />
        </div>
      </div>

      <div style={projectContainerStyle}>
        <div style={projectBoxStyle}>
          <img src={require('./images/AIPR1.jpg')} alt="Toby" style={imageStyle} />
          <div style={descriptionStyle}>
            <h2>AI Powered Recycling ~ AIPR</h2>
            <p>An award winning solution to sorting recyclable waste using artificial intellgience and robotics</p>
            <p></p>
          </div>
        </div>
      </div>


      <p></p>
      <p></p>
      <p></p>
    </header>

  );
};

const buttonStyle = {
  padding: '10px 50px',
  backgroundColor: '#556',
  color: '#fff',
  border: 'none',
  borderRadius: '10px',
  cursor: 'pointer',
};

const projectContainerStyle = {
  display: 'flex',
  justifyContent: 'space-between',
  marginTop: '100px',
  backgroundColor: '#222',
  boxShadow: '20px 20px 5px rgba(0, 0, 0, 200)'
  };
  
  const projectBoxStyle = {
  display: 'flex',
  alignItems: 'center',
  marginBottom: '20px',
  marginTop: '20px',
  marginLeft: '20px',
  };
  
  const imageStyle = {
  width: '400px',
  height: '400px',
  };
  
  const descriptionStyle = {
  marginLeft: '20px',
  };

export default Projects;
